import React from 'react';
import axios from 'axios';
import { reduxForm, Field } from 'redux-form';
import TextField from '@material-ui/core/TextField';
import {Box, Grid} from "@material-ui/core";
import Button from '@material-ui/core/Button';

const Contact = (props) => {

    const TextFieldInput = ({ input, meta, label }) => {
        // console.log('FIELD COMPONENT PROPS', props);
        return <TextField
            {...input}
            label={label}
        />;
    };

    const { handleSubmit, history } = props;

    // console.log(props);
    const handleContact = async (formValues, dispatch) => {
        console.log(formValues);

        try {
            await axios.post('/api/contact', formValues);
            // dispatch(getLogin(res.data));
            history.push('/');
        } catch (e) {
            throw new Error(e);
        }
    }

    return (
        <Box>
            <Grid container>
                <Grid xs={12}>
                    <h1>Contact</h1>
                </Grid>
                <Grid xs={12}>
                    <form noValidate autoComplete="off">
                        <Field
                            name='email'
                            label='email'
                            component={TextFieldInput}
                        />
                        <Field
                            name='name'
                            label='name'
                            component={TextFieldInput}
                        />
                        <Field
                            name='message'
                            label='message'
                            component={TextFieldInput}
                        />
                        <Button
                            onClick={ handleSubmit(handleContact) }
                            variant="contained"
                            color="primary">
                            Sign in
                        </Button>
                    </form>
                </Grid>

            </Grid>
        </Box>
    )
};


export const WrappedContact = reduxForm({ form: 'signInForm' })(Contact);
